## INTRODUCTION

The cosmic neutrino background ( $\mathrm{C} 
u \mathrm{B}$ ) fills the Universe with a present-day average number density of $n_{
u} \sim$ $336 \mathrm{~cm}^{-3}$ for all neutrino flavors [1, 2]. Also called relic neutrinos, its flux is larger by orders of magnitude than the fluxes of any other astrophysical or terrestrial neutrino source [3]. However, the energy of relic neutrinos is lower than the largest neutrino mass, which is constrained by the KATRIN experiment for electron antineutrinos to $m_{
u}<0.8 \mathrm{eV}$ [4], making its detection challenging. Indeed, relic neutrinos hardly induce detectable signals at Earth-based detectors since the energy depositions are very tiny, of order $\sim \mathrm{meV}-\mathrm{eV}$, and their interaction cross section is suppressed in the Standard Model.

An intriguing idea to detect the elusive $\mathrm{C} 
u \mathrm{B}$ is to consider cosmic rays that scatter them off, yielding a flux on Earth of relic neutrinos with larger "boosted" energies. Indeed, this was hinted in the 1980s when the neutrino mass was not constrained and the cosmic-ray flux was uncertain [5, 6]. Recently, it has been pointed out that cosmic-ray scatterings off the $\mathrm{C} 
u \mathrm{B}$ can yield a flux of neutrinos on Earth that rules out a $\mathrm{C} 
u \mathrm{B}$ overdensity in the Milky Way of $\sim 10^{13}$, or of $\sim 10^{10}$ in TXS $0506+056$, from a non-observation of an excess of events in high-energy neutrino experiments [7]. Similar bounds have been found considering the non-attenuation of the high energy neutrino flux from NGC 1068 due to scatterings off the $\mathrm{C} 
u \mathrm{B}$ during propagation [8]. Comparable bounds were also found recently from the boosted $\mathrm{C} 
u \mathrm{B}$ flux from cosmic-ray reservoirs [9] accounting for detailed modelling of the neutrino-nucleus cross section at ultra high energies and cosmic-ray composition. However, the large neutrino overdensities constrained in these studies [7-9] are unlikely to be realized in Nature, mainly due to Pauli exclusion principle which disfavours relic neutrino overdensities with values larger than $\sim 10^{6}$ [10].

The calculation of Ref. [7], while pioneering, was restricted to only single galaxies: the Milky Way and TXS $0506+056$. Nevertheless, there must be a contribution to the diffuse flux of boosted relic neutrinos reaching the Earth that arise from all other galaxies in the Universe.

Here, we calculate this diffuse flux, and find it enhances the boosted neutrino flux by many orders of magnitude, as show in Fig. 1. By comparing the predicted boosted flux to upper limits on searches for high-energy cosmogenic neutrinos by, e.g. IceCube [11], we are able to set a world-leading limit on the $\mathrm{C} 
u \mathrm{B}$ overdensity at the level of $\sim 10^{4}$, and a projected limit of $\sim 10^{3}$, for a neutrino with mass $m_{
u}=0.1 \mathrm{eV}$. Importantly, this is the first bound on the $\mathrm{C} 
u \mathrm{B}$ over cosmological timescales/distances, and future experiments may be able to probe $\mathrm{C} 
u \mathrm{B}$ overdensities below the critical density of the Universe.
